import React from 'react';
import {Navbar,Nav, NavItem} from 'react-bootstrap';
import { Link } from 'react-router-dom';
function Header(){
return(
    <div className="header">
            <Navbar expand="lg">
                <Navbar.Brand> 
                    <Link to="/DataChart">COVID-19 Cases Visualization</Link>
                </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav pullright>
                    <NavItem componentClass={Link} to="/DataChart">Home</NavItem>
                    <NavItem componentClass={Link} to="/CountrywiseBarChart">Counry Wise</NavItem>
                </Nav>
            </Navbar.Collapse>
            </Navbar>
        </div>
)
}
export default Header;
